import React, { Component } from 'react'

class CPF extends Component {
  render() {

    const { value, handleGenerico } = this.props

    return (
      <fieldset> Escreva seu CPF:
        <input 
          type="number" 
          name='CPF'
          value={value}
          onChange={ handleGenerico }
          maxLength='11'
          placeholder='Digite seu CPF meu nobre'
          />
      </fieldset>
    )

  }


}

export default CPF
